 <select name=application-name id=appSelector class=input><option value selected disabled>Choose application<option value=15 data-app='{"id":15,"name":"supply_chain_demand_forecasting","location":"/opt/feast/supply_chain","description":"Supply chain demand forecasting and inventory optimization platform for retail and manufacturing. POPIA-compliant with minimal personal data (workforce only). Uses MSSQL (ERP transactions), MySQL (supplier portal), MongoDB (IoT sensor data), PostgreSQL (demand planning), and S3 (historical time-series). 4 entities: ProductSku, DistributionNode, Supplier, and DemandForecast. Supports ML models for demand prediction, stock optimization, and supplier risk assessment with full explainability for procurement decisions.","default_owner":"Demand Planning Analytics Team","node_count":16,"edge_count":12,"created_by_username":"test","created_at":"2026-02-28T20:25:40.553755+02:00","updated_at":"2026-02-28T20:25:40.553783+02:00"}'>supply_chain_demand_forecasting<option value=6 data-app='{"id":6,"name":"telecom_customer_churn_ml","location":"/opt/feast/telecom_churn","description":"Telecommunications customer churn prediction and lifetime value optimization. POPIA-compliant with ICASA (Independent Communications Authority of SA) consumer protection alignment. Uses MSSQL (billing and CRM), MySQL (network operations), MongoDB (customer interactions), PostgreSQL (product catalog), and S3 (call detail records). 4 entities: Subscriber, MobileDevice, ServicePlan, and NetworkSession. Supports ML models for churn prediction, upsell targeting, and network experience optimization with full explainability and fairness monitoring.","default_owner":"Customer Analytics Team","node_count":16,"edge_count":14,"created_by_username":"test","created_at":"2026-02-28T19:44:28.036529+02:00","updated_at":"2026-02-28T19:44:28.036555+02:00"}'>telecom_customer_churn_ml<option value=5 data-app='{"id":5,"name":"insurance_pricing_ml_platform","location":"/opt/feast/insurance_pricing","description":"Insurance pricing and risk segmentation ML platform for life, funeral, and vehicle cover. POPIA Section 26 special personal information (health data) handling with Long-term Insurance Act compliance. Uses MSSQL (policy administration), MySQL (claims history), MongoDB (risk surveys), PostgreSQL (actuarial tables), and S3 (catastrophe modeling). 4 entities: Policyholder, InsurancePolicy, RiskEvent, and ActuarialSegment. Supports GLM, GBM, and neural network pricing models with full explainability for regulatory filing.","default_owner":"Actuarial Data Science Team","node_count":16,"edge_count":13,"created_by_username":"test","created_at":"2026-02-28T19:43:43.099194+02:00","updated_at":"2026-02-28T19:43:43.099221+02:00"}'>insurance_pricing_ml_platform<option value=4 data-app='{"id":4,"name":"healthcare_analytics_ml","location":"/opt/feast/healthcare","description":"Healthcare predictive analytics platform for patient outcomes, readmission risk, and resource optimization. POPIA-compliant with Section 26 special personal information (health data) handling. Supports clinical ML model development with full audit trails for HPCSA (Health Professions Council of SA) compliance. Uses MSSQL (hospital EHR), MySQL (patient administration), MongoDB (clinical notes), PostgreSQL (research registry), and S3 (imaging archives). 4 entities: Patient, HealthcareProvider, MedicalEpisode, and TreatmentProtocol. Implements differential privacy for training data and explainable AI for clinical decision support.","default_owner":"Clinical Data Science Team","node_count":16,"edge_count":12,"created_by_username":"test","created_at":"2026-02-28T19:41:48.137852+02:00","updated_at":"2026-02-28T19:41:48.137880+02:00"}'>healthcare_analytics_ml<option value=3 data-app='{"id":3,"name":"credit_risk_ml_platform","location":"/opt/feast/credit_risk","description":"Credit risk assessment ML platform for retail and corporate lending. Supports model development, validation, and bias testing across 5 data sources: SQL Server (core banking), MySQL (credit bureau), MongoDB (application documents), PostgreSQL (risk ratings), and S3 (training archives). Implements POPIA Section 71 automated decision-making safeguards, SARB model governance requirements, and SHAP/LIME explainability. Features 4 entities: Applicant, LoanFacility, CreditBureauProfile, and CollateralAsset. Manages 50+ risk features with TTLs from 1 hour to 90 days. All training data anonymized with differential privacy techniques. Model versioning tracked via MLflow integration. Bias monitoring across demographic groups mandatory per SARB fairness guidelines.","default_owner":"Model Risk Management Team","node_count":16,"edge_count":12,"created_by_username":"test","created_at":"2026-02-28T19:41:00.658316+02:00","updated_at":"2026-02-28T19:41:00.658344+02:00"}'>credit_risk_ml_platform</select>
